def happy_cnt(c,g):
    output =  0
    for i in range(len(c)):
        if g[i] ==0:
            output += c[i]
    return output


def maxSatisfied(customers: 'List[int]', grumpy: 'List[int]', X: int):
    output = 0
    total = happy_cnt(customers, grumpy)
    dict = {}
    dict_upto = {}
    dict_upto[0] = customers[0] * abs(grumpy[0] -1)
    dict_after = {}


    for i in range(1,len(customers)):
        curr = (customers[i] * abs(grumpy[i] -1))
        dict_upto[i] = dict_upto[i-1] + curr


    for i in range(len(customers) - X+1):
        dict[i] = sum(customers[i:i+X])
        dict_after[i] = total - dict_upto[i+X-1]


    #print(dict, dict_after , dict_before)


    for i in range(len(customers) - X+1):
        curr = (customers[i] * abs(grumpy[i]-1))
        output = max(output,  dict_upto[i] - curr + dict[i] + dict_after[i]  ) #  + dict[i] + dict_after[i] )

    return output

